  import React from 'react'

export default function Card(props) {
  return (
	<div key={props.id} className='movie'>
		<img src={props.url} alt={props.title}/>
		<div className='card-text'>
		<h2>{props.title}</h2>
		<p>{props.score}</p>
		</div>
	</div>
  )
}
